import './Button.css'

function Buttons() {
  return (
    <div class="buttonComponent">
      <div class="leftButton">
        <button onclick="">Filter</button>
      </div>

      <div class="rightButton">
        <button onclick="">Sort By</button>
      </div>
    </div>
  );
}

export default Buttons
